<head>
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
    <title>BeepBeep, desert, and the pyramid</title>
    <link href="{{ asset('css/main.css') }}" rel="stylesheet">
    <link rel="icon" href="{{ asset('images/favicon.png') }}">
    <style>
        html {
            height: 100%;
        }
        body {
            background-image: url('data:image/svg+xml;base64,');
            background-size: 100%;
            background-image: -moz-linear-gradient(290deg, #07839e 0%, #6cc3b8 23%, #fffdc4 75%, #fffebd 100%);
            background-image: -webkit-linear-gradient(290deg, #07839e 0%, #6cc3b8 23%, #fffdc4 75%, #fffebd 100%);
            background-image: linear-gradient(160deg, #07839e 0%, #6cc3b8 23%, #fffdc4 75%, #fffebd 100%);
            height: 100%;
            margin: 0;
            background-repeat: no-repeat;
            background-attachment: fixed;
        }
        svg {
            position: fixed;
            right: 0;
            bottom: 0;
            left: 0;
        }
        .moon {
            fill: #fff;
            -moz-transition: all 1s ease;
            -o-transition: all 1s ease;
            -webkit-transition: all 1s ease;
            transition: all 1s ease;
            animation: moonFrame 1s 5s forwards ease-in-out;
        }
        .pyramid-shadow {
            fill: #b69259;
            filter: progid: DXImageTransform.Microsoft.Alpha(Opacity=20);
            opacity: 0.2;
        }
        .pyramid-menkaure--shade {
            fill: #ac925c;
        }
        .pyramid-menkaure--front {
            fill: #cea364;
        }
        .pyramid-khafre--shade {
            fill: #bea060;
        }
        .pyramid-khafre--front {
            fill: #d7ae6e;
        }
        .pyramid-khufu--shade {
            fill: #b69259;
        }
        .pyramid-khufu--front {
            fill: #cea364;
        }
        .pyramid-lilBro--shade {
            fill: #b5975d;
        }
        .pyramid-lilBro--front {
            fill: #cea364;
        }
        .fog {
            filter: progid: DXImageTransform.Microsoft.Alpha(Opacity=50);
            opacity: 0.5;
            -moz-transition: all 1s ease;
            -o-transition: all 1s ease;
            -webkit-transition: all 1s ease;
            transition: all 1s ease;
            animation: fogFrame 2s infinite alternate;
        }
        .fog-layer02 {
            animation: fogFrame02 5s infinite alternate;
        }
        @keyframes moonFrame {
            0% {
                filter: progid: DXImageTransform.Microsoft.Alpha(enabled=false);
                opacity: 1;
                -moz-transform: translateY(-700px);
                -ms-transform: translateY(-700px);
                -webkit-transform: translateY(-700px);
                transform: translateY(-700px);
            }
            100% {
                filter: progid: DXImageTransform.Microsoft.Alpha(Opacity=20);
                opacity: 0.2;
                -moz-transform: translateY(0);
                -ms-transform: translateY(0);
                -webkit-transform: translateY(0);
                transform: translateY(0);
            }
        }
        @keyframes fogFrame {
            0% {
                filter: progid: DXImageTransform.Microsoft.Alpha(Opacity=40);
                opacity: 0.4;
            }
            100% {
                filter: progid: DXImageTransform.Microsoft.Alpha(Opacity=10);
                opacity: 0.1;
            }
        }
        @keyframes fogFrame02 {
            0% {
                filter: progid: DXImageTransform.Microsoft.Alpha(Opacity=0);
                opacity: 0;
            }
            50%,
            100% {
                filter: progid: DXImageTransform.Microsoft.Alpha(Opacity=20);
                opacity: 0.2;
            }
        }
    </style>
</head>
