        <p>
            BeepBeep is a very simple Twitter clone written in PHP as an example Laravel application.<br />
            Used PHP: The Right Way, an easy-to-read, quick reference for PHP popular coding standards.<br />
            It has the functions of publishing tweets and deleting tweets, following users and canceling following users,
            change user information and reset password.<br />
            An awesome social app website with a beautiful UI.
        </p>

